import React from 'react';
import { BrowserRouter as Router , Switch, Route } from "react-router-dom";
import Users from "./user/pages/User";
import './App.css';
import User from './user/pages/User';

const App = ()=> {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={User}/>
      </Switch>
    </Router>
  );
}

export default App;
